import axios from 'axios';
import {useEffect} from 'react';

export default function TutorDashboard(props) {
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);

    return <div className="calendar_container">
        <div className="calendar_header">
            <ul className="weekdays">
                <li>Sunday</li>
                <li>Monday</li>
                <li>Tuesday</li>
                <li>Wednesday</li>
                <li>Thursday</li>
                <li>Friday</li>
                <li>Saturday</li>
            </ul>

            <ul className="daynumbers">
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
            </ul>
        </div>
        <div className="timeslots_container">
            <ul className="timeslots">
                <li>9<sup>am</sup></li>
                <li>10<sup>am</sup></li>
                <li>11<sup>am</sup></li>
                <li>12<sup>am</sup></li>
                <li>1<sup>am</sup></li>
                <li>2<sup>am</sup></li>
                <li>3<sup>am</sup></li>
                <li>4<sup>am</sup></li>
                <li>5<sup>am</sup></li>
            </ul>
        </div>

        <div className="event_container">
            <div className="slot">

            </div>
        </div>
    </div>
}
